import {motion, useTransform, useScroll} from 'framer-motion';
import {useRef} from 'react';

function useParallax(value, distance) {
    return useTransform(value, [0, 1], [-distance, distance]);
  }

const Content = ({exps, setDarkMode, darkMode, pageActive}) => {
    const darkBG = darkMode ? 'bg-gray-900' : 'bg-neutral-100';
    const darkText = darkMode ? 'text-[#D1D2D3]' : 'text-gray-900';
    const darkBorder = darkMode ? 'border-[#D1D2D3]' : 'border-gray-900';

    const work = useRef(null);
    const { scrollYProgress } = useScroll({ target: work });
    const y = useParallax(scrollYProgress, 300);
    const p = [];
    exps.forEach(({id,univname, stream, content, date}) => p.push(
        <div className='w-full h-[25%] mobile:w-full flex flex-row laptop:even:flex-row-reverse desktop:even:flex-row-reverse justify-center text-center mobile:justify-around mobile:h-fit mobile:h-[60%]'>
            <div className={`hidden laptop:flex desktop:flex w-[49%] h-[40%] flex-col justify-center items-center text-right px-4 mobile:w-[25%] mobile:text-left mobile:px-0 border`}>
                <span className='text-[1.2rem] font-light mobile:text-[0.7rem]'>{date}</span>
            </div>
            {/* <div className={`w-[5%] h-full flex flex-col mobile:invisible`}></div> */}
            <div className=' w-[10%] h-full flex flex-col items-center text-center'>
                <span className={`w-[0%] border ${darkBorder} h-[15%]`}></span>
                <span className={`${darkText} w-[15%] border rounded-full p-4 flex items-center justify-center text-[0.8rem]`}><i className='fa fa-graduation-cap'></i></span>
                <span className={`w-[0%] border ${darkBorder} h-full`}></span>
            </div>
            {/* <div className='w-[5%] h-fit flex flex-col mobile:invisible '></div> */}
            <div className={`${darkBG} ${darkText} relative w-[49%] h-[80%] border-transparent flex flex-col text-left rounded-xl px-4 py-4 mobile:text-sm mobile:w-[80%] mobile:h-fit 
                before:content-[''] before:absolute before:border before:top-[30px] ${id%2 != 0 ? "before:-left-3" : "laptop:before:-right-3 desktop:before:-right-3 mobile:before:-left-3"} before:rotate-45 before:bg-inherit before:border before:border-l-transparent before:border-b-transparent before:border-t-0 before:border-r-0 before:p-[12px]`}>
                <div className={`border-b ${darkBorder} flex flex-col`}>
                    <span className='text-[1.3rem] font-normal mobile:text-[1rem]'>{univname}</span>
                    <span className='text-[1rem] font-light mobile:text-[0.8rem]'>{stream}</span>
                    <span className='hidden mobile:flex text-[1rem] font-light mobile:text-[0.75rem]'>{date}</span>
                </div>
                <ul className='pt-2 font-light mobile:h-fit mobile:p-4'>
                    {content.map((obj) => <li>{obj}</li>)}
                </ul>
            </div>
        </div>
    ))
    return (
        <>
        <div className={`hidden mobile:flex sticky top-0 left-0 right-0 flex justify-between items-center w-full z-10 p-2`}>
            <span className="text-xl font-bold text-left bg-white p-2">Workex</span>
        </div>
            <section id="academics" className='h-[100vh] mobile:w-full laptop:snap-center desktop:snap-center flex flex-col justify-center items-center px-8 pt-10 mobile:p-2'>
                {p}
            <span className={`${darkBG} ${darkText} sticky bottom-0 left-0 right-0 w-full p-2 bg-gray-300 text-center`}>Download Resume <i className="fa fa-download"></i></span>

            </section>
        </>
    )
}

